import React from 'react';
import './css/Home.css';
import profilePhoto from './../images/profilePhoto.PNG'

function Home() {
    return (
        <div className="hero-image">
            {/* <div ></div> */}
            <img className="hero-profile" src={profilePhoto} alt="Profile Photo"></img>
            <div className="hero-text">
                <h3>Hello, I'm</h3>
                <h1>David Mah</h1>
                <p>- Software Engineer -</p>
            </div>
        </div> 
    )
}

export default Home;
